import React from "react";
import PetCard from '../PetCard/PetCard.js';

function BlocksCreator(){
    const arr = [];
    for(let i = 0; i < 9; i++) {
      arr.push(this.PetCard(this.props.className));
    }
    return arr;
  }  

function AnimalsList(){


    return(

            BlocksCreator()
    )
}

export default AnimalsList;
